Where each project has a own documentation page build with mdbook, it's very distributed and hard to find all the pages of your project. If you want to combine multiple projects to one documentation, you also can use mdBook! See this example and the code repository , which loads all projects with gitsubmodules. Here is a Github Action for auto deployment. If you sidebar grows, you may need to use this css and javascript code to add a collapse feature to your sidebar. This is an example, how it could work in the future. At the moment you need to add this manual, if the project strucutre changes. SUMMARY.md # Summary
